package inn.custom.processor;

import java.sql.PreparedStatement;
import java.text.SimpleDateFormat;
import java.util.Arrays;
import java.util.Date;
import java.util.List;

import org.apache.commons.lang3.time.DateUtils;
import org.apache.nifi.flowfile.FlowFile;
import org.apache.nifi.processor.ProcessContext;
import org.apache.nifi.processor.ProcessSession;
import org.apache.nifi.processor.Relationship;
import org.slf4j.Logger;
import org.slf4j.LoggerFactory;

import com.inn.commons.lang.StringUtils;
/**
 * @author ist
 *
 */
public class SnippetToPreQuaterEntry implements Runnable {

    private Logger logger = LoggerFactory.getLogger(SnippetToPreQuaterEntry.class);

    public FlowFile runSnippet(FlowFile flowFile, ProcessSession session, ProcessContext context,
      java.sql.Connection con, String cacheValue) {

    	String hadoopBasePath = flowFile.getAttribute("hadoopBasePath");
    	String domain=flowFile.getAttribute("domain");
    	String emsType=flowFile.getAttribute("emsType");
    	String vendor=flowFile.getAttribute("vendor");
    	String module=flowFile.getAttribute("module");
    	String technology=flowFile.getAttribute("technology");
    	String jobType=flowFile.getAttribute("jobType");
    	Date date = DateUtils.addDays(new Date(), 1);
		SimpleDateFormat hdfsformate = new SimpleDateFormat("yyyyMMdd");
		SimpleDateFormat audittimeformat = new SimpleDateFormat("yyyy-MM-dd");
		 PreparedStatement statement = null;
    	for(int i=0;i<24;++i) {
    		List<String> quarters = jobType.equalsIgnoreCase("HOURLY")?Arrays.asList("00"):Arrays.asList("00","15","30","45");
    		for(String quarter : quarters) {
    			String fileName = hadoopBasePath+hdfsformate.format(date)+"/"+StringUtils.leftPad(String.valueOf(i), 2, "0")+quarter+"/";
    			String auditDate = audittimeformat.format(date);
    			String audittime = audittimeformat.format(date)+" "+StringUtils.leftPad(String.valueOf(i), 2, "0")+":"+quarter+":00";
    			 try {
					statement = con.prepareStatement("Insert into ProcessingAudit(`filename`,`domain`,`vendor`,`module`,`auditdate`,`audittime`,`emstype`,`technology`) "
							+ " values (?,?,?,?,?,?,?,?)");
					statement.setString(1, fileName);
					statement.setString(2, domain);
					statement.setString(3, vendor);
					statement.setString(4, module);
					statement.setString(5, auditDate);
					statement.setString(6, audittime);
					statement.setString(7, emsType);
					statement.setString(8, technology);

					statement.execute();
				}catch(Exception e) {
					logger.error("Exception in inserting DAa ");
					session.transfer(flowFile, new Relationship.Builder().name("failure")
							.description("IOException occured while getting router IPs from Database").build());
					return flowFile;
				}
    		}
    	}
        session.transfer(flowFile, new Relationship.Builder().name("success")
            .description("FlowFiles that were successfully processed").build());
        return flowFile;
    }

    @Override
    public void run() {

    }
}
